Goodbye, Miss 4th of July

This is the story of a Greek immigrant family who settled in Montgomery, West Virginia, in the 1910.They experience the prejudice and friendship that many immigrants have felt. The historical setting includes the days leading up to the United States entering World War I and the Influenza epidemic of 1917. 


